import {
  Avatar,
  Button,
  CardActions,
  CardContent,
  Typography,
} from "@mui/material";
import React from "react";

export default function Post(props) {
  const { username, content } = props;

  return (
    <React.Fragment>
      <CardContent>
        <Avatar />
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          {username}
        </Typography>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          What i have to say...
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Delete</Button>
      </CardActions>
    </React.Fragment>
  );
}
